import { Link } from 'react-router-dom';

const Socials: React.FC = () => {
  return (
    <div style={{ background: 'white' }}>
      
      <Link to="/">WhatsApp</Link>
      <Link to="/Facebook.com">Facebook</Link>
      <Link to="/Youtube.com">Youtube</Link>
       </div>
  );
};

export default Socials;
